class Creating_Feed():
	def __init__ (self,user_id,summary,url,image):
		self.user_id=user_id
		self.summary=summary
		self.url=url
		self.image=image
		self.storedimage=""
		self.username=""
		self.profile_picture=""
		self.hashtag=[]
		self.to_hashtag=[]
		self.user_timelinefeed=[]
		self.passing_global_feed=[]
